episodes.description:
@Drberg is a Chiropractor who has a huge reach online dispensing health and nutrition advice. His son, Ian Rafalko claims his online persona is at odds with who he actually is as a person in private. 

This was an emotional episode delving into topics of alleged narcissism, greed, child abuse and cult membership. 

I have invited @Drberg to respond to these allegations and will provide a forum for him to do so, as I want to make sure all sides have a chance to be heard.
